import { AccessAlarm, ThreeDRotation } from '@mui/icons-material';

const CpacityBattery = (capacity, mentees_num) => {
    let full_fruction = mentees_num / capacity;
    if (full_fruction == 0) {
      return <AccessAlarm.Battery0BarTwoToneIcon/>;
    }
    if (full_fruction <= 0.2) {
      return <Battery20/>;
    }
    if (full_fruction <= 0.4) {
      return Battery30;
    }
    if (full_fruction <= 0.5) {
      return Battery50;
    }
    if (full_fruction <= 0.6) {
      return Battery60;
    }
    if (full_fruction <= 0.8) {
      return Battery80;
    }
    if (full_fruction < 1) {
      return Battery90;
    }
    else {
      return BatteryFull;
    }
  };
  
  export default CpacityBattery;
